import React from "react"
import {Typography} from "@material-ui/core"
import {useStyle} from './useStyle'


export const Home = (props) => {
    const classes = useStyle();

    return (
        <div className={classes.root}>
            <Typography>Hi</Typography>
        </div>
    )
};
